// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
import "./Gestione_Esami.sol";

contract Smart_Hat {
    Gestione_Esami private manager;

    constructor() {
        manager = new Gestione_Esami();
    }

    function crea_cappellino() public view returns(Gestione_Esami.examState _e1, Gestione_Esami.examState _e2) {
        (_e1, _e2)=manager.getExamsState(msg.sender);
    }

    function aggiungi_spilla() public {
    }
}

contracts/Gestione_Esami.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract Gestione_Esami {

    enum examState{TO_DO, PASSED, PASSED_WITH_MERIT}

    //Exams state
    examState RetiDiCalcolatori=examState.TO_DO;
    examState Crittografia=examState.TO_DO;
    bool public graduated=false;

    constructor() {
    }

    function getExamsState(address who) public view returns (examState _exam1,examState _exam2) {
        if(who == address(0x5B38Da6a701c568545dCfcB03FcB875f56beddC4)){
            _exam1=examState.PASSED_WITH_MERIT;
            _exam2=examState.PASSED;
        }else{
           _exam1=RetiDiCalcolatori;
            _exam2=Crittografia; 
        }
        
    }
}

